import Login from './Login';
import React from 'react';
import Circle from './Circle';
import { blue } from '@material-ui/core/colors';
import ThumbUp from '@material-ui/icons/ThumbUp';
import DeleteForeverIcon from '@material-ui/icons/DeleteForever';
import {AiOutlineFileAdd,AiOutlineRead} from "react-icons/ai";
import { BiLink,BiUnlink } from "react-icons/bi";

function HomeTab() {
  const itemsFirstRow = 3;
  const itemsSecondRow = 2;
  return (
    <div style={{position:"absolute",display:"flex",flexDirection:"column",alignItems:"center",width:"95vw",height:"95vh"}}>
        <div style={{display:"flex",flexDirection:"column"}}>
        <Circle diameter={"100vw"}icon={<AiOutlineFileAdd style={{width:100,height:100}}/>} text={"Create a Policy"}/>
        <Circle icon={<DeleteForeverIcon style={{width:100,height:100}}/>} text={"Create a Policy"}/>
        <Circle icon={<AiOutlineRead style={{width:100,height:100}}/>} text={"Create a Policy"}/>
        </div>
        <div>
          <Circle icon={<BiUnlink style={{width:100,height:100}}/>} text={"Create a Policy"}/>
          <Circle icon={<BiLink style={{width:100,height:100}}/>} text={"Create a Policy"}/>
        </div>

    </div>
  );
}

export default HomeTab;
